import{_ as e,c as i,o as a,ab as s}from"./chunks/framework.CUflZczI.js";const b=JSON.parse('{"title":"Налагодження з GDB","description":"","frontmatter":{},"headers":[],"relativePath":"uk/debug/gdb_debugging.md","filePath":"uk/debug/gdb_debugging.md"}'),t={name:"uk/debug/gdb_debugging.md"},l=s('<h1 id="налагодження-з-gdb" tabindex="-1">Налагодження з GDB <a class="header-anchor" href="#налагодження-з-gdb" aria-label="Permalink to &quot;Налагодження з GDB&quot;">​</a></h1><p><a href="https://sourceware.org/gdb/documentation/" target="_blank" rel="noreferrer">Налагоджувач GNU (GDB)</a> інстальовано разом з інструментарієм компілятора у вигляді бінарного файлу <code>arm-none-eabi-gdb</code>. Налагоджувач читає символи відладки у файлі формату виконання ELF щоб зрозуміти статичну та динамічну структуру пам&#39;яті прошивки PX4. Для доступу до мікроконтролера автопілота PX4, йому потрібно з&#39;єднатися з <a href="https://sourceware.org/gdb/current/onlinedocs/gdb.html/Connecting.html" target="_blank" rel="noreferrer">віддаленою ціллю</a>, яка надається <a href="./swd_debug.html">зондом налагодження за протоколом SWD</a>.</p><p>Плин інформації виглядає таким чином:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">Розробник</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">=</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> GDB</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">=</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> сервер</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> GDB</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">=</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> зонд</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> налагодження</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">=</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> SWD</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">=</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> автопілот</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> PX4.</span></span></code></pre></div><h2 id="швидкии-старт" tabindex="-1">Швидкий старт <a class="header-anchor" href="#швидкии-старт" aria-label="Permalink to &quot;Швидкий старт&quot;">​</a></h2><p>Для початку сеансу налагодження вам зазвичай потрібно:</p><ol><li>Спеціалізований <a href="./../debug/swd_debug.html#debug-probes">зонд налагодження за протоколом SWD</a>.</li><li>Знайти та під&#39;єднатися до <a href="./../debug/swd_debug.html#autopilot-debug-ports">порту налагодження SWD</a>. Можливо знадобиться <a href="./swd_debug.html#debug-adapters">адаптер налагодження</a>.</li><li>Налаштувати та запустити зонд налагодження для створення сервера GDB.</li><li>Запустити GDB та під&#39;єднатись до сервера GDB як віддаленої цілі.</li><li>Налагоджувати прошивку інтерактивно.</li></ol><p>Дивіться документацію зонда налагодження для додаткової інформації як налаштувати з&#39;єднання для налагодження:</p><ul><li><a href="./probe_jlink.html">SEGGER J-Link</a>: комерційний зонд, без вбудованої послідовної консолі, потребує адаптер.</li><li><a href="./probe_bmp.html">Зонд Black Magic</a>: інтегрований сервер GDB та послідовна консоль, потребує адаптер.</li><li><a href="./probe_stlink.html">STLink</a>: найкраще співвідношення ціни та якості, вбудована послідовна консоль, адаптер потрібно паяти.</li></ul><p>Рекомендуємо використовувати J-Link з адаптером налагодження Pixhawk або STLinkv3-MINIE зі спеціально спаяним кабелем.</p><p>Після підключення ви можете використовувати звичайні команди GDB, такі як:</p><ul><li><code>continue</code> для продовження виконання програми</li><li><code>run</code> для того, щоб почати спочатку</li><li><code>backtrace</code> для перегляду траси стеку</li><li><code>break somewhere.cpp:123</code> для встановлення точки зупину</li><li><code>delete somewhere.cpp:123</code> для видалення точки зупину</li><li><code>info locals</code> для отримання локальних змінних</li><li><code>info registers</code> для отримання регістрів</li></ul><p>Зверніться до <a href="https://sourceware.org/gdb/documentation/" target="_blank" rel="noreferrer">документації GDB</a> для отримання додаткових відомостей.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Щоб уникнути необхідності вводити всі команди для підключення в GDB кожен раз, ви можете записати їх у файл <code>~/.gdbinit</code>.</p></div><h2 id="наступні-кроки" tabindex="-1">Наступні кроки <a class="header-anchor" href="#наступні-кроки" aria-label="Permalink to &quot;Наступні кроки&quot;">​</a></h2><p>Ви під&#39;єднали контролер польоту до налагоджувального зонда SWD!</p><p>Наступні розділи пояснюють, як розпочати налагодження на цільовій платформі:</p><ul><li><a href="./eclipse_jlink.html">Налагодження з MCU Eclipse/J-Link для PX4</a>.</li><li><a href="./../dev_setup/vscode.html">Visual Studio Code IDE (VSCode)</a>.</li></ul><h2 id="вбудовані-інструменти-налагодження" tabindex="-1">Вбудовані інструменти налагодження <a class="header-anchor" href="#вбудовані-інструменти-налагодження" aria-label="Permalink to &quot;Вбудовані інструменти налагодження&quot;">​</a></h2><p><a href="https://pypi.org/project/emdbg/" target="_blank" rel="noreferrer">Вбудовані інструменти налагодження</a> поєднують декілька програмних та апаратних інструментів налагодження разом у зручному пакеті Python щоб полегшити складні випадки налагодження для мікроконтролерів ARM Cortex-M та пов&#39;язаних пристроїв.</p><p>Ця бібліотека організовує запуск та налаштування апаратних зондів налагодження та зондів трасування, налагоджувачів, логічних аналізаторів, генераторів сигналу та надає інструменти аналізу, перетворювачі та плагіни для отримання суттєвого розуміння стану програмного та апаратного забезпечення під час або після виконання.</p><p>Бібліотека <code>emdbg</code> містить <a href="https://github.com/Auterion/embedded-debug-tools/blob/main/src/emdbg/debug/gdb.md#user-commands" target="_blank" rel="noreferrer">багато корисних плагінів GDB</a> що спрощують налагодження PX4. Вона також надає інструменти для <a href="https://github.com/Auterion/embedded-debug-tools/tree/main/ext/orbetto" target="_blank" rel="noreferrer">профілювання PX4 в реальному часі</a>.</p>',22),r=[l];function h(d,n,o,p,k,g){return a(),i("div",null,r)}const u=e(t,[["render",h]]);export{b as __pageData,u as default};
